import React from "react";
import "./HomeDisplay.css";

class HomeDisplay extends React.Component {
  render() {
    return (
      <div id="HomeDisplay">
        <span class="homeSnippet big">Web Developement</span>
      </div>
    );
  }
}

export default HomeDisplay;
